interface ProjectIconProps {
  project: ProjectList;
  className?: string;
  fillColor?: string;
}

export const ProjectIcon: FunctionComponent<ProjectIconProps> = ({
  project,
  className,
  fillColor,
}) => {
  const Components: Record<ProjectList, FunctionComponent<IconProps>> = {
    "datagovmy": DataGovMyIcon,
    "datagovmy-docs": DataGovMyIcon,
    "hansard": HansardIcon,
    "mybelanjawan": MoneyIcon,
    "nas": MapIcon,
    "opendosm": OpenDOSMIcon,
    "sharegovmy": ShareIcon,
  };

  const Icon = Components[project];

  if (typeof Icon !== "undefined") {
    return createElement(Icon, { className, fillColor });
  }
  return createElement(JataNegara, { className });
};

export default ProjectIcon;
